import React, { Component } from 'react'

export class ShowContact extends Component {
  render() {
    return (
      <div className='menu'>
        <div className='blur'/>
        <div className='menu__content'>
          <div className='menu__header'>Контакты</div>
          <FaTimes className='krestik' onClick={() => this.props.onShowContact()}/>
          <ul>
            <li><a>WhatsApp</a></li>
            <li><a>Telegram</a></li>
            <li><a>Instagram</a></li>
          </ul>
        </div>
      </div>
    )
  }
}

export default ShowContact
